别人探索的解决方案, 可能每个人不一样, 仅供参考, 最好每执行一次就run一下, 看是哪里的错误, 然后有针对性的下药
按照常理安装echarts, 接着发现报错(原因就是没有跟着rn更新)
Invariant Violation: WebView has been removed from React Native. It can now be installed and imported from 'react-native-webview' instead of 'react-native'. See 'https://github.com/react-native-community/react-native-webview'.
大致意思就是WebView不在从react-native里面import了, 改从react-native-webview, 这不是坑爹吗?

echarts的rn版本更新也是一年前, 要么换要么改一下源码, 或者等它更新

if(换图表 || 等更新){
  可以不用往下看了
}else{
  继续往下看
}

以下方案均google而来


. 找到native-echarts的目录\node_modules\native-echarts\src\index.js, 同样\node_modules\native-echarts\src\components\Echarts\index.js

当然还得在native-echarts执行一下安装命令npm install react-native-webview
原先是这样import的
import { WebView } from 'react-native';
换一下
import { WebView } from 'react-native-webview';

. 打开Android studio,找到file-settings-sdk tool-勾选上29.0.3-点击apply, 回到项目里\android\build.gradle, 修改
ext {
buildToolsVersion = "29.0.3"
compileSdkVersion = 29
}

. 回到\node_modules\native-echarts\src\components\Echarts\index.js,改一下webview里面的写法


记住要把这个tpl文件复制一份到\android\app\src\main\assets, 如果没有目录, 那就新建一个
原先是这样写的
source={require('./tpl.html')}
改为
source={Platform.OS === 'ios' ? require('./tpl.html') : { uri: "file:///android_asset/tpl.html" }}

